import { 
  LoginButton,
  RegisterButton,
  LogoutButton,
  AddListButton,
  AddCardButton
} from '../components/Buttons'

export function Test() {
  return (
    <div>
      <LoginButton />
      <RegisterButton />
      <LogoutButton />
      <AddListButton />
      <AddCardButton />
    </div>
  )
}
